import React, { Component } from 'react';
import { GoogleLogin } from 'react-google-login';

import './FooterSection.css';

class FooterSection extends Component {
	onSignIn = user => {
		console.log(user);

		axios
			.get('http://localhost:8888/server/confirmUser.php')
			.then(res => {
				console.log(res);
			})
			.catch(function(error) {
				console.log(error);
			});

		// fetch('http://localhost:8888/server/confirmUser.php', {
		// 	method: 'POST',
		// 	headers: {
		// 		'Content-Type': 'application/json'
		// 	},
		// 	credientials: 'omit',
		// 	body: JSON.stringify({
		// 		id_token: user.tokenId
		// 	})
		// })
		// 	// .then(resp => resp.json()) // Transform the data into json
		// 	.then(data => {
		// 		console.log('WTF', data.json());
		// 		this.props.history.push('/members');
		// 	});
	};

	responseGoogle = response => {
		console.log('res', response);
	};

	render() {
		return (
			<div className="footer">
				<div className="icons">
					<a
						className="icon fa fa-facebook-square"
						href="https://www.facebook.com/TheFishingClubAtMichiganTech/?fref=ts"
					>
						<span />
					</a>
					<a className="icon fa fa-instagram" href="https://www.instagram.com/mtu_fishingclub/">
						<span />
					</a>
					<a className="icon fa fa-envelope" href="kldanko@mtu.edu">
						<span />
					</a>
					<GoogleLogin
						className="icon fa fa-sign-in"
						style={{
							backgroundColor: 'transparent',
							border: 'none',
							margin: 0,
							padding: 0,
							color: '#fff'
						}}
						clientId="1073431930974-rse6ic0teqt7jd401secn08m3ovdsf4l.apps.googleusercontent.com"
						buttonText=""
						onSuccess={this.onSignIn}
						onFailure={this.onSignIn}
					/>
				</div>
				<p style={{ paddingTop: 15 }}>Website by Jake Mager</p>
			</div>
		);
	}
}

export default FooterSection;
